import React from 'react';

const Contact = () => {
  return (
    <section className='mt-44  flex flex-col items-center justify-center'>
      <div className='text-8xl text-center lg:px-72  mb-8'>
        Hi there! Can't find what you need?
      </div>
      <div className='text-center text-customGrey'>
        Please get in touch and our support team will answer all your questions.
      </div>
      <div className='flex text-customGrey items-center'>
        You can send a message to <span className='ml-1 text'>neurox.co.uk</span>
      </div>
    </section>
  );
};

export default Contact;
